import { Link } from "react-router-dom";
import { useLocation } from 'react-router-dom';

import Balloons from '../assets/Home/balloons.png';
import Sea from '../assets/Home/sea.png';

const Navigation = () => {
    return (
        <navigation className="nav-bar">
                <div className="nav-contacts">
                    <img src={Balloons} alt="" width="45" />
                    <a href="">CONTACTS</a>
                </div>

                <div className="nav-items">
                    <div className="nav-item">
                        <Link to="/" style={{ padding: 5 }} id="nav-link">
                        ABOUT
                        </Link>
                        <img src={Sea} alt="" width="28" />
                    </div>
                    <div className="nav-item">
                        <Link to="/projects" style={{ padding: 5 }} id="nav-link">
                            PROJECTS
                        </Link>
                        {/* <a href="">PROJECTS</a> */}
                        <img src={Sea} alt="" width="28" />
                    </div>
                </div>
            </navigation>
    )
}

export default Navigation;
